        function meterDist(a,b){
            // приближённое расстояние между двумя точками (lat,lon) в метрах
            var R = 6371000;
            var lat1 = a[0]*Math.PI/180, lat2 = b[0]*Math.PI/180;
            var dLat = (b[0]-a[0])*Math.PI/180;
            var dLon = (b[1]-a[1])*Math.PI/180;
            var sa = Math.sin(dLat/2)*Math.sin(dLat/2) + Math.cos(lat1)*Math.cos(lat2)*Math.sin(dLon/2)*Math.sin(dLon/2);
            var c = 2*Math.atan2(Math.sqrt(sa), Math.sqrt(1-sa));
            return R*c;
        }

        function showNearestStreet() {
            if (!navigator.geolocation) { alert("Геолокация не поддерживается"); return; }
            if (!STREETS || STREETS.length === 0) { alert("На карте нет улиц для поиска"); return; }

            navigator.geolocation.getCurrentPosition(function(pos){
                var user = [pos.coords.latitude, pos.coords.longitude];
                var bestIdx = -1;
                var bestDist = Infinity;

                for (var i=0;i<STREETS.length;i++) {
                    var s = STREETS[i];
                    if (!s.mid) continue;
                    var d = meterDist(user, s.mid);
                    if (d < bestDist) { bestDist = d; bestIdx = i; }
                }

                if (bestIdx === -1) { alert("Не удалось найти ближайшую улицу на карте"); return; }

                var best = STREETS[bestIdx];
                // подсветим улицу (отрисуем поверх карты)
                var poly = L.polyline(best.coords, {color: '#1f78b4', weight: 12, opacity:0.8}).addTo(MAP);
                var mid = best.mid || (best.coords && best.coords[Math.floor(best.coords.length/2)]);
                if(mid) {
                    L.popup().setLatLng(mid).setContent("Ближайшая улица: <b>" + best.name + "</b><br>Расстояние: " + Math.round(bestDist) + " м").openOn(MAP);
                    MAP.flyTo(mid, 16);
                } else {
                    MAP.setView([user[0], user[1]], 15);
                    L.popup().setLatLng(user).setContent("Ближайшая улица: <b>" + best.name + "</b><br>Расстояние: " + Math.round(bestDist) + " м").openOn(MAP);
                }
                // добавить маркер пользователя
                L.circleMarker(user, {radius:6, color:'#333', fillColor:'#fff', weight:2}).addTo(MAP).bindPopup("Вы здесь").openPopup();

            }, function(err) {
                alert("Ошибка геопозиции: " + err.message);
            }, {enableHighAccuracy:true});
        }

        var btn = document.createElement("button");
        btn.textContent = "Показать ближайшую улицу ко мне";
        btn.style.position = "absolute";
        btn.style.top = "10px";
        btn.style.left = "50%";
        btn.style.transform = "translateX(-50%)";
        btn.style.zIndex = 99999;
        btn.style.padding = "8px 12px";
        btn.style.background = "white";
        btn.style.border = "1px solid #888";
        btn.style.borderRadius = "6px";
        btn.onclick = showNearestStreet;
        document.body.appendChild(btn);

    });
    </script>
